I gotta give y’all a little update:
with everything going on I’ve been quiet about my music projects for a while. Don’t think we been sleeping on new music. Next to playing 8 shows a week  with @hamilton_deutschland  and hosting battles arround Europe, I produced a German solo album project  between January and March 
With the homeboy @tacka77 

this year we’ll be dropping at least 15 new tracks, in German as well as English. It might even be more.

Up first is a collab with my brother @hughaugustinemc coming through from L.A. while on tour with @isaiahrashad. We haven’t linked in 5 years so when I heard he was coming through we had to get some studio time in. Both of us developed a lot since we last touched base - Hugh used to be out here in Hamburg way back in his school days and we share a lot of family and friends since he stood with folks I was playing football with back then. Now the only Touch Down we landing are on the plane to the next gig 🛬

Made a quick beat with the homie @alo431_bbg and this is the result 

Check our brand new single ,,Touch Down’‘ available everywhere June 12th 

Produced by Redchild
Recorded, mixed and mastered @chaoscompressorclub 

Presave on @spotify via link in bio it would help out a lot 🙏🏽

Shout to all the supporters who helped us come up with a video in no time 

